import React, { Component } from 'react';
import './component.css';
import img from '../assets/info2.jpg';

class Footer extends Component {

    render(){
        return(
            <div className='footer'>
                <div className='footer-line'>
                    Reach to us!
                </div>
                <div className='footer-contact'>
                    <div className='f1'>
                    <img className="footer-img" src={img} alt="" /><br/>
                    <h3>Contact Info</h3>
                        <hr /> <br />
                        <div className='f-contact'>
                        <div className='f-c'>Mobile &nbsp;:&nbsp; <a href="tel:+9477754">+94 77 754 0000</a></div>
                        <div className='f-c'>Land &nbsp;&nbsp;&nbsp;&nbsp;:&nbsp;<a href="tel: +94114572139">+94 11 457 2139</a></div>
                        <div className='f-c'>Email &nbsp;&nbsp;&nbsp;:&nbsp;&nbsp; <a href="mailto:name@gmail.com">name@gmail.com</a></div>
                        </div>
                    </div>
                    <div className='f2'>
                    We are a team of passionate people whose goal is to
                     improve everyone's life through disruptive products. 
                     We build great products to solve your business 
                     problems. Our products are designed for small to large
                      scale companies willing to optimize their performance.
                    </div>
                </div>
            </div>
        );
    }
}

export default Footer;
